import React from 'react';
import Banner from '../components/common/Banner';
import ListAgency from '../components/agencies/ListAgency';

function Agencies() {
    return (
        <div>
            <Banner page="Lữ HÀNH" title="Lữ hành"/>
            <ListAgency/>          
        </div>
    )
}

export default Agencies;
